import React from "react";

export default class Hand extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      cards: [],
    };
  }

  render() {
    return (
      <div
        class="row"
        style={{ border: "1px black", height: 100, backgroundColor: "red" }}
      >
        {this.state.cards}
      </div>
    );
  }
}
